import React from 'react'

class Register extends React.Component {

	constructor() {
		super()
	}

	handleSubmit() {

	}

	handleChange() {

	}

	render() {
		return (
			<div className='container'>
				<form onSubmit={this.handleSubmit}>
					<div className='form-group'>
						<label>Name</label>
						<input type='text' placeholder='Name' className='form-control' onChange={this.handleChange} />
					</div>
					<div className='form-group'>
						<label>Email</label>
						<input type='text' placeholder='Email' className='form-control' onChange={this.handleChange} />
					</div>
					<div className='form-group'>
						<label>Mobile No</label>
						<input type='text' placeholder='Mobile No' className='form-control' onChange={this.handleChange} />
					</div>
					<div className='form-group'>
						<input type='submit' className='btn btn-primary' />
					</div>
				</form>
			</div>
		)
	}
}

export default Register
